import React from "react";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { ApiApi } from "../../../../util/gen/api/dist";

type HomePageProps = {
  setClient: React.Dispatch<React.SetStateAction<{}>>;
  setQueryInfo?: Function;
  apiService?: ApiApi;
};

const HomePage: React.FC<HomePageProps> = (props) => {
  const login = () =>
    props.apiService?.apiClientsRetrieve(1).then((value) => {
      props.setClient(value.data);
    });
  return (
    <div>
      <button onClick={login}></button>
      <Link to="/allprofiles">Login</Link>
    </div>
  );
};

export default HomePage;
